  `id` VARCHAR(64) NOT NULL COMMENT '医院信息表id标识',
  `pid` VARCHAR(64) DEFAULT NULL COMMENT '上一级',
  `hospital_name` VARCHAR(64) DEFAULT NULL COMMENT '医院名称',
  `flag_stop` INT(11) DEFAULT '1' COMMENT '停用标记 0=停用，1=启用',
  `stop_code` VARBINARY(64) DEFAULT NULL COMMENT '停用人id',
  `stop_name` VARCHAR(64) DEFAULT NULL COMMENT '停用人名称',
  `stop_date` DATETIME DEFAULT NULL COMMENT '停用时间',
  `stop_explain` VARCHAR(1024) DEFAULT NULL COMMENT '停用说明',
  `remark` VARCHAR(1024) DEFAULT NULL COMMENT '备注',
  `state` INT(11) DEFAULT '0' COMMENT '状态',
  `crt_code` VARCHAR(64) DEFAULT NULL COMMENT '创建人id',
